// src/pages/Home.js
import React from 'react';
import '../Home.css';

function Home() {
  return (
    <div>
      <h2>Welcome to Data Profile</h2>
      <p>This is a simple data profile website built with React.js.</p>
    </div>
  );
}

export default Home;
